sections.code:
/* 1. DONUT BULLETS */

.bullet, #bulletBucket .bulletBucketBullet,
.page.showCompleted .project.halfOpenSearchMatchAncestorWhenCompletedVisible:not(.shared):not(.addedShared)>.name>.bullet,
.page:not(.showCompleted) .project.halfOpenSearchMatchAncestorWhenCompletedHidden:not(.shared):not(.addedShared)>.name>.bullet  {
    background-image: url("data:image/svg+xml;charset=UTF-8,%3csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 100 100' version='1.1'%3e%3ccircle cx='50' cy='50' r='20' stroke='black' stroke-width='2' fill='transparent'/%3e%3c/svg%3e");
    background-color: rgba(211,211,211, .3);
}    

/* 2. SHARED LISTS */

.project.shared>.name>.bullet {
    background-color: #cbecf3 !important;
    box-shadow: 0px 0px 5px #98b9c0;
} 


/* 3. EMBEDDED LISTS */

.project.addedShared>.name>.bullet {
    background-color: #dadaf7 !important;
    box-shadow: 0px 0px 5px #7d7d93;
}

/* GLOBAL FONT STYLING */
#documentView {
    font-family: Monospace !important;
    color: #333333 !important;
}

/* TAG STYLING */
.contentTag {
    font-family: Courier;
    color: #0489B1 !important;
}

/* LINK STYLING */
.content .contentLink {
    color: lightgray;
    font-family: Courier;
    text-transform: none !important;
}

/* NOTE STYLING */
.noted > .notes > .content {
    font-family: Anonymous Pro !important;
    font-style: italic;
    color: #333333 !important;
    opacity: 0.6;
}

/* GIVE CURSOR FOCUS BACKGROUND COLOR */ 
.selected.project div:focus{
    background-color: palegoldenrod;
}   

/* GIVE CURSOR FOCUS RIGHT BORDER DOTTED 
.selected.project div:focus{
    border-right: 4px dotted rgba(0, 0, 0, 1) !important;
    padding-right: 5px !important;
    margin-right: 30px !important;
    border-radius: 5px 0px 0px 5px !important;
}                */                                         

/* GIVE CURSOR FOCUS RIGHT BORDER SOLID 
.selected.project div:focus{
    border-right: 4px solid black !important;
    padding-right: 5px !important;
    margin-right: 30px !important;
    border-radius: 5px 0px 0px 5px !important;
}     */

:root {
	--circle-opacity: rgba(0,0,0,0.0);
    --circle-hover-color: rgba(0,0,0, 0.5);
	--content: "â—¯";
	--font-family: AvenirNext-UltraLight;
}



.contentTag[title*="Filter #b-" ]:before {
	content: var(--content);
	display: inline !important;
	visibility: visible !important;
	color: var(--circle-opacity) !important;
	font-family: var(--font-family) !important;
}
.contentTag[title*="Filter #b-" ]:hover:before {
	color: var(--circle-hover-color) !important;
}




